// TranslationCacheModule.js
class TranslationCache {
  async initialize() {
    try {
      const dbName = "TranslationCache";
      const storeName = "translations";
      const request = indexedDB.open(dbName, 1);

      request.onupgradeneeded = () => {
        const db = request.result;
        const store = db.createObjectStore(storeName, { keyPath: "key" });
        store.createIndex("value", ["value"]);
      };

      this._database = await new Promise((resolve, reject) => {
        request.onsuccess = () => resolve(request.result);
        request.onerror = (event) =>
          reject(new Error(`indexedDB open failed: ${event}`));
      });

      this._database.onversionchange = () => {
        this._database.close();
      };

      this._database.onerror = (event) => {
        console.error("Database error:", event.target.error);
      };

      this._database.onclose = () => {
        console.log("Database closed");
      };

      return this._database;
    } catch (err) {
      throw err;
    }
  }

  async add(key, value) {
    const transaction = this._database.transaction(
      ["translations"],
      "readwrite",
    );
    const objectStore = transaction.objectStore("translations");
    const request = objectStore.add({ key, value });

    await new Promise((resolve, reject) => {
      request.onsuccess = resolve;
      request.onerror = reject;
    });
  }

  async get(key) {
    const transaction = this._database.transaction(
      ["translations"],
      "readonly",
    );
    const objectStore = transaction.objectStore("translations");
    const request = objectStore.get(key);

    return await new Promise((resolve, reject) => {
      request.onsuccess = () => resolve(request.result?.value);
      request.onerror = reject;
    });
  }
}

let translationCacheInstance;

export async function getTranslationCache() {
  if (!translationCacheInstance) {
    translationCacheInstance = new TranslationCache();
    await translationCacheInstance.initialize();
  }
  return translationCacheInstance;
}

// Importing 'client' from Gradio library directly from CDN
import { client } from "./client.js";

async function translateText(text, targetLanguage) {
  console.log("taget", targetLanguage);

  const cache = await getTranslationCache();
  const cacheKey = `${targetLanguage}:${encodeURIComponent(text)}`;
  let storedTranslation = await cache.get(cacheKey);
  if (storedTranslation) {
    return Promise.resolve(storedTranslation);
  }

  // Replace 'someClientFunction' with the actual method from the Gradio library
  const app = await client(
    "https://facebook-seamless-m4t.hf.space/--replicas/l26v8/",
  );
  const result = await app.predict("/run", [
    "T2ST (Text to Speech translation)",
    "microphone",
    {
      data: `data:audio/wav;base64,`,
      name: "audio.wav",
    },
    null,
    text,
    "English",
    targetLanguage,
  ]);

  // Store the translation in IndexedDB
  await cache.add(cacheKey, result.data[1]);
  console.log(result.data[1]);

  return result.data[1];
}

export { translateText };
